

def moy(tab):
	return sum(tab)//len(tab)
def calcul_k(fichier):
	file = open(fichier, "r")
	lines = file.readlines()
	file.close()
	content = []
	for line in lines:
		content.append(int(line.strip()))
	i = 0
	k = ""
	cpt = 0
	while i+55 < len(content):
		tmp = content[i:i+55]
		m = moy(tmp)
		if m >= 65 :
			i += 100
			k+="1"
			cpt += 1
		else :
			i += 45
			k+="0"
	
	return int(k, 2)
	
if __name__ == "__main__":

	
	k = calcul_k('SPATrace.dat')
	print(k)



